import React from 'react';
import styled from 'styled-components';
import './Logo.js';

const NavButtonS = styled.div`
  cursor: pointer;
  text-align : center;
  line-height : 36px;
  width: 80px;
  height: 36px;
  border-radius: 12px;
  font-size: 16px;
  text-align: center;
  font-family:'bitbit';
  font-weight: 100;
  margin-left: ${(props) => props.marginLeft};
`;

function NavButton({ children }) {

  return <NavButtonS marginLeft>{children}</NavButtonS>;
}

export default NavButton;
